import React, {Component} from "react"
import {Nav, Navbar, NavDropdown} from "react-bootstrap"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
}from "react-router-dom";

import Home from "../pages/Home";
//import Opkut from "../pages/Opkut";
import Bfa from "../pages/Bfa";
import Test from "../testpages/Test";
import Login from "../pages/Login";
import Mester from "../pages/Mester";
import LoginForm from "../login/LoginForm"

export default class Navbar1 extends Component{
  render(){

    return(
    <Router>
    <div>
    <Navbar bg='dark' variant="dark">     
    
    <Nav>
    <Nav.Link as={Link} to={"/"} >Kezdőlap</Nav.Link>
    
    <Nav.Link as={Link} to={"/test"} className="navbtn">Teszt</Nav.Link>

      <NavDropdown title="Algo2" className="navbtn">
        <NavDropdown.Item as={Link} to={"/bfa"}>Bfa</NavDropdown.Item>
        <NavDropdown.Item as={Link} to={"/mester"}>Mester Tétel</NavDropdown.Item>
      </NavDropdown>
  
      
      <Nav.Link href='/logintest' className="navbtn">LoginTest</Nav.Link>

      <button class="damo" onClick={Damo}>Dm</button>

      <Nav.Link href='/login' className="loginbtn">Login</Nav.Link>

    </Nav>
    </Navbar>
    
    <div>
      <Routes>
        <Route path="/bfa" element={<Bfa/>}/>
        <Route path="/test" element={<Test/>}/>
        <Route path="/mester" element={<Mester/>}/>
        <Route path="/" element={<Home/>}/>        
        <Route path="/login" element={<Login/>}/>        
        <Route path="/logintest" element={<LoginForm/>}/>        
      </Routes>
    </div>
    </div> 
    </Router>
    )   
  }
}

function Damo() {
  var element = document.body;
  element.classList.toggle("dark-mode");

}
